--
-- Name: search_similar_embeddings(public.vector, double precision, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.search_similar_embeddings(query_vector public.vector, match_threshold double precision DEFAULT 0.7, match_count integer DEFAULT 5) RETURNS TABLE(id integer, text text, metadata jsonb, similarity double precision)
    LANGUAGE plpgsql
    AS $$
BEGIN
    RETURN QUERY
    SELECT
        embeddings.id,
        embeddings.text,
        embeddings.metadata,
        1 - (embeddings.vector <=> query_vector) AS similarity
    FROM embeddings
    WHERE 1 - (embeddings.vector <=> query_vector) > match_threshold
    ORDER BY embeddings.vector <=> query_vector
    LIMIT match_count;
END;
$$;


